import React from 'react';
import "./Header1.css";
import { Nav,NavLink } from 'reactstrap';

const Header1 = (props) => {
  return (
    <div className="header1">
      <div className="leftSide">
        <div className="links">
          <a href="#">Home</a>
          <a href="#">Html</a>
          <a href="#">Css</a>
          <a href="#">JavaScript</a>

        </div>

      </div>
      <div className="rightSide"></div>
    </div>
  );
}

export default Header1;
